import React from "react";
import { Grid } from "@mantine/core";
import ImageTest from "./ImageTest";
import TextTemplate from "./TextTemplate";
import Drawer from "./Drawer";

const Index = () => {
  return (
    <Grid h="100%" >
      <Grid.Col span={4}>
        <ImageTest />
      </Grid.Col>
      <Grid.Col span={4}>
        <TextTemplate />
      </Grid.Col>
      <Grid.Col span={4}>
        <Drawer />
      </Grid.Col>
    </Grid>
  );
};

export default Index;
